<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Virtual Campus Calendar Comparison</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            padding: 20px;
        }
        
        .comparison-container {
            max-width: 2400px;
            margin: 0 auto;
        }
        
        .title-section {
            background: white;
            border-radius: 12px;
            padding: 20px;
            margin-bottom: 20px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            text-align: center;
        }
        
        .title-section h1 {
            color: #1a202c;
            font-size: 2em;
            margin-bottom: 10px;
        }
        
        .title-section p {
            color: #4a5568;
            font-size: 1.1em;
        }
        
        .panels-wrapper {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 20px;
        }
        
        .panel {
            background: white;
            border-radius: 12px;
            padding: 20px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }
        
        .panel-header {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
            padding: 15px;
            border-radius: 8px;
            margin-bottom: 20px;
            text-align: center;
        }
        
        .panel-header h2 {
            font-size: 1.5em;
            margin-bottom: 5px;
        }
        
        .panel-header p {
            font-size: 0.9em;
            opacity: 0.9;
        }
        
        .controls {
            display: grid;
            grid-template-columns: 1fr 1fr 1fr;
            gap: 15px;
            margin-bottom: 20px;
        }
        
        .control-group {
            display: flex;
            flex-direction: column;
        }
        
        .control-group label {
            color: #4a5568;
            font-size: 0.9em;
            margin-bottom: 5px;
            font-weight: 500;
        }
        
        .control-group select {
            padding: 10px;
            border: 2px solid #e2e8f0;
            border-radius: 6px;
            font-size: 1em;
            background: white;
            cursor: pointer;
            transition: all 0.2s;
        }
        
        .control-group select:hover {
            border-color: #667eea;
        }
        
        .control-group select:focus {
            outline: none;
            border-color: #667eea;
            box-shadow: 0 0 0 3px rgba(102, 126, 234, 0.1);
        }
        
        .stats {
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            gap: 10px;
            margin-bottom: 20px;
            padding: 15px;
            background: #f7fafc;
            border-radius: 8px;
        }
        
        .stat-item {
            text-align: center;
        }
        
        .stat-value {
            font-size: 1.8em;
            font-weight: bold;
            color: #667eea;
        }
        
        .stat-label {
            font-size: 0.85em;
            color: #718096;
            margin-top: 4px;
        }
        
        .legend {
            display: flex;
            flex-wrap: wrap;
            gap: 10px;
            padding: 15px;
            background: #f7fafc;
            border-radius: 8px;
            margin-bottom: 20px;
        }
        
        .legend-item {
            display: flex;
            align-items: center;
            gap: 8px;
            font-size: 0.9em;
        }
        
        .legend-color {
            width: 20px;
            height: 20px;
            border-radius: 4px;
        }
        
        .calendar-container {
            display: flex;
            flex-direction: column;
            gap: 20px;
        }
        
        .month-section {
            background: #f8f9fa;
            border-radius: 8px;
            padding: 15px;
        }
        
        .month-header {
            font-size: 1.3em;
            font-weight: bold;
            color: #2d3748;
            margin-bottom: 15px;
            text-align: center;
        }
        
        .month-grid {
            display: grid;
            grid-template-columns: repeat(7, 1fr);
            gap: 8px;
        }
        
        .day-header {
            text-align: center;
            font-weight: bold;
            color: #4a5568;
            padding: 8px;
            font-size: 0.85em;
        }
        
        .day-cell {
            background: white;
            border: 1px solid #e2e8f0;
            border-radius: 6px;
            min-height: 120px;
            padding: 8px;
            position: relative;
            width: 100%;
        }
        
        .day-cell.today {
            border: 2px solid #667eea;
            box-shadow: 0 0 0 2px rgba(102, 126, 234, 0.2);
        }
        
        .day-cell.other-month {
            background: #f7fafc;
            border-color: #f0f0f0;
        }
        
        .day-number {
            font-weight: bold;
            color: #2d3748;
            margin-bottom: 6px;
            font-size: 0.9em;
        }
        
        .course-item {
            background: #4a5568;
            color: white;
            padding: 4px 8px;
            border-radius: 4px;
            font-size: 0.75em;
            margin-bottom: 4px;
            cursor: pointer;
            transition: all 0.2s;
            white-space: normal;
            word-wrap: break-word;
            line-height: 1.3;
        }
        
        .course-item:hover {
            transform: translateY(-2px);
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
        }
        
        .popup-overlay {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: rgba(0, 0, 0, 0.5);
            z-index: 1000;
            align-items: center;
            justify-content: center;
        }
        
        .popup-overlay.active {
            display: flex;
        }
        
        .popup-content {
            background: white;
            border-radius: 12px;
            padding: 30px;
            max-width: 500px;
            width: 90%;
            max-height: 80vh;
            overflow-y: auto;
            box-shadow: 0 10px 25px rgba(0, 0, 0, 0.2);
        }
        
        .popup-header {
            display: flex;
            justify-content: space-between;
            align-items: start;
            margin-bottom: 20px;
        }
        
        .popup-title {
            font-size: 1.5em;
            font-weight: bold;
            color: #2d3748;
            flex: 1;
        }
        
        .popup-close {
            background: #e2e8f0;
            border: none;
            border-radius: 6px;
            width: 32px;
            height: 32px;
            display: flex;
            align-items: center;
            justify-content: center;
            cursor: pointer;
            font-size: 1.5em;
            color: #4a5568;
            transition: all 0.2s;
        }
        
        .popup-close:hover {
            background: #cbd5e0;
        }
        
        .popup-details {
            display: flex;
            flex-direction: column;
            gap: 15px;
        }
        
        .detail-row {
            display: flex;
            padding: 12px;
            background: #f7fafc;
            border-radius: 6px;
        }
        
        .detail-label {
            font-weight: 600;
            color: #4a5568;
            min-width: 120px;
        }
        
        .detail-value {
            color: #2d3748;
            flex: 1;
        }
        
        @media (max-width: 1400px) {
            .panels-wrapper {
                grid-template-columns: 1fr;
            }
        }
        
        @media (max-width: 768px) {
            .controls {
                grid-template-columns: 1fr;
            }
            
            .stats {
                grid-template-columns: 1fr;
            }
            
            .legend {
                flex-direction: column;
            }
        }
    </style>
</head>

            </div>
        </div>
    </div>

    </div>

        // Function to convert a color to a muted version for phantom panel
        function getMutedColor(hexColor) {
            // Convert hex to RGB
            const r = parseInt(hexColor.slice(1, 3), 16);
            const g = parseInt(hexColor.slice(3, 5), 16);
            const b = parseInt(hexColor.slice(5, 7), 16);
            
            // Mix with gray (128, 128, 128) at 50% to desaturate
            const mutedR = Math.round(r * 0.5 + 128 * 0.5);
            const mutedG = Math.round(g * 0.5 + 128 * 0.5);
            const mutedB = Math.round(b * 0.5 + 128 * 0.5);
            
            // Convert back to hex
            return `#${mutedR.toString(16).padStart(2, '0')}${mutedG.toString(16).padStart(2, '0')}${mutedB.toString(16).padStart(2, '0')}`;
        }
        
        function getFilteredData(panelId, data) {
            const monthFilter = document.getElementById(`monthSelect-${panelId}`).value;
            const yearFilter = document.getElementById(`yearSelect-${panelId}`).value;
            const levelFilter = document.getElementById(`levelFilter-${panelId}`).value;
            
            return data.filter(item => {
                const monthMatch = monthFilter === 'all' || item.month === parseInt(monthFilter);
                const yearMatch = yearFilter === 'all' || item.year === parseInt(yearFilter);
                const levelMatch = levelFilter === 'all' || item.level === levelFilter;
                return monthMatch && yearMatch && levelMatch;
            });
        }
        
        function updateStats(panelId, data) {
            const filtered = getFilteredData(panelId, data);
            const totalCourses = filtered.length;
            const totalEnrollments = filtered.reduce((sum, item) => sum + (item.enrollment || 0), 0);
            const uniqueLevels = [...new Set(filtered.map(item => item.level))].length;
            
            document.getElementById(`stats-${panelId}`).innerHTML = `
                <div class="stat-item">
                    <div class="stat-value">${totalCourses}</div>
                    <div class="stat-label">Courses</div>
                </div>
                <div class="stat-item">
                    <div class="stat-value">${totalEnrollments}</div>
                    <div class="stat-label">Enrollments</div>
                </div>
                <div class="stat-item">
                    <div class="stat-value">${uniqueLevels}</div>
                    <div class="stat-label">Levels</div>
                </div>
            `;
        }
        
        function createLegend(panelId) {
            const legendContainer = document.getElementById(`legend-${panelId}`);
            const levels = Object.keys(levelColors);
            
            legendContainer.innerHTML = levels.map(level => {
                const color = panelId === 'prior' ? getMutedColor(levelColors[level]) : levelColors[level];
                return `
                    <div class="legend-item">
                        <div class="legend-color" style="background-color: ${color}"></div>
                        <span>${level}</span>
                    </div>
                `;
            }).join('');
        }
        
        function showCoursePopup(course) {
            const popup = document.getElementById('popup');
            const title = document.getElementById('popup-title');
            const details = document.getElementById('popup-details');
            
            title.textContent = course.displayName;
            
            details.innerHTML = `

                    <span class="detail-label">Course ID:</span>
                    <span class="detail-value">${course.courseId}</span>
                </div>
                <div class="detail-row">

                <div class="detail-row">
                    <span class="detail-label">End Date:</span>
                    <span class="detail-value">${course.endDate || 'Not specified'}</span>
                </div>
                <div class="detail-row">
                    <span class="detail-label">Level:</span>
                    <span class="detail-value">${course.level}</span>
                </div>
                <div class="detail-row">
                    <span class="detail-label">Enrollment:</span>
                    <span class="detail-value">${course.enrollment} students</span>
                </div>
                <div class="detail-row">
                    <span class="detail-label">Class ID:</span>
                    <span class="detail-value">${course.classId}</span>

                ${course.schedule ? `

                        <span class="detail-label">Schedule:</span>
                        <span class="detail-value">${course.schedule}</span>

                ` : ''}
            `;
            
            popup.classList.add('active');

        function closePopup() {
            document.getElementById('popup').classList.remove('active');
        }
        
        document.getElementById('popup').addEventListener('click', (e) => {
            if (e.target.id === 'popup') closePopup();
        });
        
        function populateDropdowns(panelId, data) {
            console.log(`Populating dropdowns for ${panelId}, data length: ${data.length}`);
            
            if (!data || data.length === 0) {
                console.error(`No data for ${panelId} panel!`);
                return;
            }
            
            const months = [...new Set(data.map(item => item.month))].sort((a, b) => a - b);
            const years = [...new Set(data.map(item => item.year))].sort((a, b) => a - b);
            const levels = [...new Set(data.map(item => item.level))].sort();
            
            console.log(`${panelId} - Months:`, months);
            console.log(`${panelId} - Years:`, years);
            console.log(`${panelId} - Levels:`, levels);
            
            // Determine default month and year based on panel
            const today = new Date();
            const currentMonth = today.getMonth() + 1; // JavaScript months are 0-indexed
            const currentYear = today.getFullYear();
            const priorYear = currentYear - 1;
            
            // For current panel, use today's date; for prior panel, use one year ago
            const defaultMonth = panelId === 'current' ? currentMonth : currentMonth;
            const defaultYear = panelId === 'current' ? currentYear : priorYear;
            
            const monthSelect = document.getElementById(`monthSelect-${panelId}`);
            monthSelect.innerHTML = '<option value="all">All Months</option>' +
                months.map(m => {
                    const selected = m === defaultMonth ? ' selected' : '';
                    return `<option value="${m}"${selected}>${monthNames[m]}</option>`;
                }).join('');
            
            const yearSelect = document.getElementById(`yearSelect-${panelId}`);
            yearSelect.innerHTML = '<option value="all">All Years</option>' +
                years.map(y => {
                    const selected = y === defaultYear ? ' selected' : '';
                    return `<option value="${y}"${selected}>${y}</option>`;
                }).join('');
            
            const levelFilter = document.getElementById(`levelFilter-${panelId}`);
            levelFilter.innerHTML = '<option value="all">All Levels</option>' +
                levels.map(l => `<option value="${l}">${l}</option>`).join('');
        }
        
        function getDaysInMonth(month, year) {
            return new Date(year, month, 0).getDate();
        }
        
        function getFirstDayOfMonth(month, year) {
            return new Date(year, month - 1, 1).getDay();
        }
        
        function createCalendar(panelId, data) {
            const container = document.getElementById(`calendar-${panelId}`);
            container.innerHTML = '';
            
            const monthFilter = document.getElementById(`monthSelect-${panelId}`).value;
            const yearFilter = document.getElementById(`yearSelect-${panelId}`).value;
            
            const filtered = getFilteredData(panelId, data);
            const months = monthFilter === 'all' 
                ? [...new Set(filtered.map(item => item.month))].sort((a, b) => a - b)
                : [parseInt(monthFilter)];
            
            months.forEach(month => {
                const monthSection = document.createElement('div');
                monthSection.className = 'month-section';
                
                // Calculate year for this calendar - declare ONCE
                const currentYear = new Date().getFullYear();
                const calendarYear = yearFilter !== 'all' ? parseInt(yearFilter) : 
                     (panelId === 'current' ? currentYear : currentYear - 1);
                
                const monthHeader = document.createElement('div');
                monthHeader.className = 'month-header';
                monthHeader.textContent = `${monthNames[month]} ${calendarYear}`;
                
                const monthGrid = document.createElement('div');
                monthGrid.className = 'month-grid';
                
                const dayHeaders = ['Sun', 'Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat'];
                dayHeaders.forEach(day => {
                    const dayHeader = document.createElement('div');
                    dayHeader.className = 'day-header';
                    dayHeader.textContent = day;
                    monthGrid.appendChild(dayHeader);
                });
                
                const daysInMonth = getDaysInMonth(month, calendarYear);
                const firstDay = getFirstDayOfMonth(month, calendarYear);
                
                for (let i = 0; i < firstDay; i++) {
                    const emptyCell = document.createElement('div');
                    emptyCell.className = 'day-cell other-month';
                    monthGrid.appendChild(emptyCell);
                }
                
                for (let day = 1; day <= daysInMonth; day++) {
                    const dayCell = document.createElement('div');
                    dayCell.className = 'day-cell';
                    
                    const today = new Date();
                    if (today.getFullYear() === calendarYear && 
                        today.getMonth() === month - 1 && 
                        today.getDate() === day) {
                        dayCell.classList.add('today');
                    }
                    
                    const dayNumber = document.createElement('div');
                    dayNumber.className = 'day-number';
                    dayNumber.textContent = day;
                    dayCell.appendChild(dayNumber);
                    
                    const filtered = getFilteredData(panelId, data);
                    const coursesForDay = filtered.filter(item => 
                        item.month === month && item.day === day && 
                        (yearFilter === 'all' || item.year === parseInt(yearFilter))
                    );
                    
                    coursesForDay.forEach(course => {
                        const courseItem = document.createElement('div');
                        courseItem.className = 'course-item';
                        courseItem.textContent = course.displayName;
                        const baseColor = levelColors[course.level] || '#6b7280';
                        courseItem.style.backgroundColor = panelId === 'prior' ? getMutedColor(baseColor) : baseColor;
                        courseItem.onclick = () => showCoursePopup(course);
                        courseItem.title = `Click for details: ${course.displayName} (${course.enrollment} enrolled)`;
                        dayCell.appendChild(courseItem);
                    });
                    
                    monthGrid.appendChild(dayCell);
                }
                
                const totalCells = Math.ceil((firstDay + daysInMonth) / 7) * 7;
                const cellsUsed = firstDay + daysInMonth;
                for (let i = cellsUsed; i < totalCells; i++) {
                    const emptyCell = document.createElement('div');
                    emptyCell.className = 'day-cell other-month';
                    monthGrid.appendChild(emptyCell);
                }
                
                monthSection.appendChild(monthHeader);
                monthSection.appendChild(monthGrid);
                container.appendChild(monthSection);
            });
        }
        
        // Initialize both panels
        function initPanel(panelId, data) {
            populateDropdowns(panelId, data);
            createLegend(panelId);
            createCalendar(panelId, data);
            updateStats(panelId, data);
            
            ['monthSelect', 'yearSelect', 'levelFilter'].forEach(id => {
                document.getElementById(`${id}-${panelId}`).addEventListener('change', () => {
                    createCalendar(panelId, data);
                    updateStats(panelId, data);
                });
            });
        }
        
        // Initialize both calendars
        initPanel('current', processedDataCurrent);
        initPanel('prior', processedDataPrior);
    </script>
</body>
</html>
